import React from "react";
import './styles.css';

const Menu = ({ onRouteChange }) => {
  return (
    <div className="container">
      <div className="title">What Jellycat are you?</div>
      <a href="#" className="start-button" onClick={onRouteChange}>
        Start
      </a>
      <div className="game-container" id="game-container">
        <div className="story-text" id="story-text"></div>
        <div className="choices" id="choices"></div>
      </div>
    </div>
  );
};

export default Menu;
